/* eslint-disable  */
import React from 'react';
import axios from 'axios';
import { Redirect } from 'react-router';
import { connect } from 'react-redux';
import {
  Form,
  Button,
  Card,
  Container,
  Row,
  Col,
} from 'react-bootstrap';
// import { Image as CloudinaryImage } from 'cloudinary-react';
import NavBar from '../../NavBar';
import { URL } from '../../env';
import DatePicker from 'react-datepicker';
import "react-datepicker/dist/react-datepicker.css";
import Moment from 'react-moment';
import moment from 'moment';

class SystemReport extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      resdata: null,
      redirect: false,
    };
    this.handleChange = this.handleChange.bind(this);
  }


  componentDidMount() {

    axios.get(`${URL}/systemReport`)
      .then((res) => {
        if (res) {
          console.log(res);
          console.log(res.data);
          this.setState({
              resdata: [res.data],
          })
        //   const dt = moment(res.data).format('MM-DD-YYYY hh:mm').toString();
        //   console.log(dt);
        //   this.setState({ time: dt });
        }
      }).catch((err) => {
        throw err;
      });
  }




  handleChange = (e) => {


  console.log(this.state.days, this.state.months, this.state.year);
  var config = {
    method: 'post',
    url: `${URL}/systemTime`,
    headers: { 
      'Content-Type': 'application/json'
    },
    data : {days: this.state.days, months: 0, year: 0}
  };

  axios(config)
  .then( (response) => {
    console.log(JSON.stringify(response));
    console.log(response.status);
    if(response.status === 200){
      // console.log("DASHD");
      this.setState({
        redirect: true
      });
    }
  })
  .catch(function (error) {
    console.log(error);
  });
//   this.setState({
//     startTime: startTime,
//   });
//   console.log(this.state.startTime);
  }

  handleChangeR = (e) => {


    console.log(this.state.days, this.state.months, this.state.year);
    var config = {
      method: 'post',
      url: `${URL}/systemTime`,
      headers: { 
        'Content-Type': 'application/json'
      },
      data : {days: 0, months: 0, year: 0}
    };

    axios(config)
    .then( (response) => {
      console.log(JSON.stringify(response));
      console.log(response.status);
      if(response.status === 200){
        // console.log("DASHD");
        this.setState({
          redirect: true
        });
      }
    })
    .catch(function (error) {
      console.log(error);
    });
  //   this.setState({
  //     startTime: startTime,
  //   });
  //   console.log(this.state.startTime);
    }


  render() {
    let redirectVar = null;
    console.log(this.state.resdata);
    if (this.state.redirect) {
      redirectVar = <Redirect to="/homepage" />;
    }
    if(!this.state.resdata){
        return(
            <div>
                <h1>Loading</h1>
            </div>
        )
    }
      return ( 
      <div>
        <NavBar />
        {redirectVar}
        <div>
          <Form inline>
            <Container>
              <Row>
              <Col>
               <Card style={{ width: '25rem', margin: '2rem' }}>
                <Card.Header>
                  System Report
                </Card.Header>
                <Card.Body>
                  <Card.Title>Last 90 Days</Card.Title>

                  {/* <Card.Text>
                    {item.address.city}
                  </Card.Text>
                  <Card.Text>
                    {moment(item.startDateTime).format('YYYY-MM-DD hh:mm').toString()}
                    &nbsp; &nbsp; &nbsp;
                    {moment(item.signUpDeadline).format('YYYY-MM-DD hh:mm').toString()}
                  </Card.Text> */}
                  </Card.Body>
                  <Card.Body>
                  {this.state.resdata.map((item) => (
                      <div>
                  <Card.Text>
                  Number of Created Events: {item.numberOfCreatedEvents}
                  </Card.Text>
                  <Card.Text>
                  Number of Cancelled Events: {item.numberOfCancelledEvents}
                  </Card.Text>
                  <Card.Text>
                  Number of Finished Events: {item.numberOfFinishedEvents}
                  </Card.Text>
                  <Card.Text>
                  Percentage of Paid Events: {item.percentageOfPaidEvents}
                  </Card.Text>
                  <Card.Text>
                  Participant Request/Min Participants: {!item.numberOfParticipationRequestsDividedByTheTotalNumberOfMinimumParticipants?(item.numberOfParticipationRequestsDividedByTheTotalNumberOfMinimumParticipants):(0)}
                  </Card.Text>
                  <Card.Text>
                  Avg No. of Participants: {item.averageNumberOfParticipantsOfTheseEvents}
                  </Card.Text>
                  </div>))}
                </Card.Body>
              </Card>
              </Col>
              </Row>
            </Container>
          </Form>
        </div>
      </div>
      );

  }
}

export default SystemReport;
